import React from 'react';
import './App.css';
import HomepageImage from './components/HomepageImage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Smurfs</h1>/>
        <p>
          This is a test paragraph.
        </p>
      </header>
    </div>
  );
}

export default App;
